import React, { } from 'react'
import '../Css/about.css';

export default function AboutUs() {
    return (
      <div className="form-container-2">
        <h1><b>This is Lifeclip</b></h1><br></br>
        <p>
        Welcome to Lifeclip, where inspiration meets insight. We are more than just a blog; we're a community of storytellers, thought leaders, and creatives, united by a shared love for exploration and discovery. Our mission is to curate engaging content that sparks conversations, fosters connections, and inspires personal growth.
        </p>
        <p>
        Behind each post is a team passionate about diverse perspectives and the power of authentic storytelling. Join us on this journey as we navigate the realms of knowledge, creativity, and the human experience. Together, let's uncover the extraordinary in the ordinary and celebrate the beauty of shared stories.
        </p>
        <br></br><hr></hr><br></br>
        <h1>Who's On the Team?</h1>
      </div>
    );
  }
